description: Raw MS2, MS3 scans from direct infusion mass spectrometry (DIMS) and
  a demo ion tree database 'mzDB' derived from the DIMS data are included. The demo
  database is used to show the functionalities provided by the 'iontree' package,
  not for the purpose of compound identification by any means.
